import styles from "./styles.module.scss";
import Link from "next/link";

const Layout = ({ children }: any) => (
  <div>
    <div className={styles.container}>
      <nav>
        <Link href="/">
          <a>
            <span className={styles.main__title}>Hacker Next</span>
          </a>
        </Link>
      </nav>
      {children}
    </div>
  </div>
);

export default Layout;
